function initTogglePassword() {
	$(".toggle-password").click(function(e) {
		e.preventDefault();
		$(this).toggleClass('view-change');
		var input = $(this).parent('.row').children('input');
		if (input.attr("type") == "password") {
			input.attr("type", "text");
		} else {
			input.attr("type", "password");
		}
	});
}

// init mobileScroll
function initMobileScroll() {
	$('.area-frame .arrow-mobile-prev').on('click', movePrev);
	$('.area-frame .arrow-mobile-next').on('click', moveNext);

	function moveNext(e) {
		let $scroller = $('.area-holder .area-frame').first(),
			$articles = $('.area-holder .area-slider').children(),
			width = $articles.first().outerWidth();
		$scroller.animate({
			scrollLeft: $scroller.scrollLeft() + width
		}, "slow");
	}
	function movePrev(e) {
		let $scroller = $('.area-holder .area-frame').first(),
			$articles = $('.area-holder .area-slider').children(),
			width = $articles.first().outerWidth();
		$scroller.animate({
			scrollLeft: $scroller.scrollLeft() - width
		}, "slow");
	}
}

function initFile() {
	$("#fileUpload").on('change', function() {
		//Get count of selected files
		var countFiles = $(this)[0].files.length;
		var imgPath = $(this)[0].value;
		var extn = imgPath.substring(imgPath.lastIndexOf('.') + 1).toLowerCase();
		var image_holder = $(".image-uploaded");
		image_holder.empty();
		if (extn == "gif" || extn == "png" || extn == "jpg" || extn == "jpeg") {
			if (typeof(FileReader) != "undefined") {
				//loop for each file selected for uploaded.
				for (var i = 0; i < countFiles; i++)
				{
					var reader = new FileReader();
					reader.onload = function(e) {
						$("<img />", {
							"src": e.target.result,
							"class": "thumb-image"
						}).appendTo(image_holder).parents('.image-holder').addClass('uploaded');
					}
					image_holder.show();
					reader.readAsDataURL($(this)[0].files[i]);
				}
			} else {
				alertToast("This browser does not support FileReader.");
			}
		} else {
			alertToast("Pls select only images");
		}
	});
}

