function initCustomLabel() {
	var activeClass = 'parent-active';
	jQuery('.flying-label').each(function () {
		var label = jQuery(this),
			parent = label.closest('.row');

		if (parent.length) {
			var input = parent.find('input, textarea');

			input.on('input', function (e) {
				setLabelState(parent, true);
			});

			input.on('focus', function (e) {
				setLabelState(parent, true);
			});

			input.on('blur', function (e) {
				if (!input.val().length) {
					setLabelState(parent, false);
				}
			});

			checkInput(input, parent);
		}
	});

	function checkInput (input, block) {
		if (input.length && block.length) {
			setLabelState( block, (input.val().length ? true : false) );
		}
	}

	function setLabelState (block, add) {
		if (block.length) {
			add ? block.addClass(activeClass) : block.removeClass(activeClass);
		}
	}
}

