//init isotope filtration
function initIsotope() {
	var activeClass = 'active',
		filterLinks = jQuery('.list-filters a'),
		grid = jQuery('.filtration-grid');

	jQuery('.block-filters').each(function() {
		var holder = jQuery(this),
			gridItems = grid.find('.item-holder, .accordion-item');

		grid.isotope({
			itemSelector: '.item-holder, .accordion-item',
			layoutMode: 'fitRows',
			transitionDuration: 0
		});

		filterLinks.on( 'click', filterFn);
	});

	function filterFn(e) {
		e.preventDefault();

		var filterLink = jQuery(this),
			filterValue = filterLink.attr('data-filter');
		if(!filterLink.hasClass(activeClass)) {
			grid.isotope({ filter: filterValue });
			filterLinks.removeClass(activeClass);
			filterLink.addClass(activeClass);
		}
	}
}

